    // }
  }

  componentDidMount() {
    this.getData()
  }
  render() {
    let { componentDisplay } = this.state

    console.log(`Data: ${JSON.stringify(componentDisplay)}`)
    return (
      <div className='Container__content-wrapper'>
        <Promo />
        <Catalog />
      </div>
    )
  }
}
